import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';

import Header from './commoncomponent/header';
import Content from './homecomponent/content';
import ContactUs from './homecomponent/contactus';
import Footer from './commoncomponent/footer';


export default function FixedContainer() {

  const loggedUser = JSON.parse(localStorage.getItem('userLoginData'));
  let setLogin;
  if(loggedUser == null){
    setLogin = false;
  }else{
    if(loggedUser == 'admin@gmail.com')
      setLogin = true;
    else
      setLogin = false;
  }

  return (
    <React.Fragment>
      <CssBaseline />
      <Typography component="div" style={{ backgroundColor: '#ffffff', height: '100%' }} >
        <Header />
        {setLogin? <p>test</p>: <div><Content /><ContactUs /><Footer /></div>}

      </Typography>
    </React.Fragment>
  );
}
